import React from "react";
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';
const Note=()=>{
    return(
        <>
           <div className="note">
          <h1> Title</h1><br></br>
          <p>
            this is the content
          </p><br></br>
           <DeleteOutlineIcon className="deleteIcon" />
           </div>
        </>
    );

}
export default Note;
